const stockMarketData = [
	{
		stockName: 'Apple',
		ticker: 'AAPL',
		startingPrice: 70,
		monthlyGrowth: 5,
	},
	{
		stockName: 'Tesla',
		ticker: 'TESL',
		startingPrice: 80,
		monthlyGrowth: 30,
	},
	{
		stockName: 'Facebook',
		ticker: 'FB',
		startingPrice: 80,
		monthlyGrowth: 20,
	},
];

export default stockMarketData;
